node.text:
@eat.kai has a minimal menu, but the vegan options are tasty! 😜 

We had yummy 🥑 and scrambled sriracha tofu on sourdough toast and a fluffy pancake stack with peanut butter and banana, sprinkled (more like covered🤣) in icing sugar. 

Definitely recommend if you’re in the area 👌

@oowee_vegan seitan chicken style burger, baconaise, smoked gouda cheese, bacon, hash brown and lettuce 🍔 alllll vegan baby 🌱 
I also had their mac n cheese and an oreo milkshake (DIVINE😍) 
They’re based in Bristol, Brighton and London ✌️
